import React from 'react'
import { Button, Grid, Typography } from '@material-ui/core'

const Header = ({ username }) => {

	const handleLogOut = () => {

		fetch('http://localhost:3000/api/authentication/logout')
			.then((response) => response.json())
			.then((response) => {
				window.location.href = '/login';
			})
	}

	//TODO
	//handleLogoutClick()

	return (
		<header id="header">
			<Typography variant="h1">{username}</Typography>
			<Grid container direction="row" justify="center" alignItems="stretch" spacing={3}>
				<Grid item>
					<div id="text-logo" onClick={() => window.location.href = "/"} style={{ cursor: "pointer" }}>
						<Typography variant="h5" >Youtube Downloader</Typography>
					</div>
				</Grid>
				<Grid item md={6} xs={6} lg={6}></Grid>
				<Grid item>
					{username ?
						(<Button variant="contained" color="primary" onClick={handleLogOut} size="small">Logout</Button>) :
						<Button variant="contained" color="primary" size="small" href="/login">Login</Button>}
				</Grid>
			</Grid>
		</header>
	)
}

export default Header
